import React, { Component } from "react";
import { withStyles } from "@material-ui/core";
import PropTypes from "prop-types";
import img from "../image/lake.jpg";
import img2 from "../image/mount.jpg";
import img3 from "../image/camera.jpg";
const styles = {
  ima: {
    width: "100%",
    height: "900px"
  },
  home: {
    marginTop: "-20%"
  }
};
class Home extends Component {
  render() {
    const { classes } = this.props;
    return (
      <div>
        <div>
          <img className={classes.ima} src={img} alt="img" />
          <button className="home button1">
            {" "}
            <h2>Kroz objektiv</h2>
          </button>{" "}
          <h4 className="header">Obožavaš fotografirati?</h4>
          <h4 className="header2">
            Ili si početnik te želiš naučiti više o fotografiji?
          </h4>
          <h4 className="header3">Pridruži se i nauči nešto novo svaki dan!</h4>
          <h3 className="header4">
            Blog za profesionalce, amatere te za sve znatiželjne!
          </h3>
        </div>
        <div>
          <h4 className="middle">Imaš iskustva? </h4> <br />
          <h4 className="middle2">Kreiraj i podijeli svoje znanje!</h4>
        </div>

        <div className="footer">
          <p>Sve slike su preuzete s https://unsplash.com</p>
        </div>
      </div>
    );
  }
}

Home.propTypes = {
  classes: PropTypes.object.isRequired
};
export default withStyles(styles)(Home);
